import React from 'react';

interface InputProps {
  label: string;
  placeholder: string;
}

export const Input: React.FC<InputProps> = ({ label, placeholder }) => {
  return (
    <div className="mx-10 pt-2">
      <div className="text-sm font-medium text-left pb-1">
        {label}
      </div>
      <input
        placeholder={placeholder}
        className="w-80 border rounded-md px-2 py-2"
      />
    </div>
  );
};
